import React from 'react';

const styles = {
  app: {
    textAlign: 'center',
    backgroundColor: '#f4f4f4',
    minHeight: '100vh',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  },
  nav: {
    backgroundColor: '#444',
    color: 'white',
    padding: '20px',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    height: '100px',
    width: '100%',
    boxSizing: 'border-box',
    marginTop: '0', // Removed space above the nav bar
  },
  logo: {
    marginLeft: '20px',
    fontSize: '1.5rem',
    fontWeight: 'bold',
  },
  navUl: {
    listStyleType: 'none',
    padding: 0,
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
  },
  navLi: {
    margin: '0 15px',
    cursor: 'pointer',
  },
  loginButton: {
    backgroundColor: '#555',
    color: 'white',
    padding: '10px 15px',
    borderRadius: '5px',
    cursor: 'pointer',
    marginRight: '20px',
  },
  aboutSection: {
    marginTop: '20px',
    marginBottom: '75px',
    textAlign: 'left',
    paddingLeft: '20px',
  },
  introductionHeading: {
    fontSize: '2rem',
    fontWeight: 'bold',
    color: '#333',
  },
  introductionContent: {
    fontSize: '1.2rem',
    color: '#555',
  },
  imageContainer: {
    width: '100%',
    marginBottom: '20px',
    boxSizing: 'border-box',
  },
  image: {
    width: '100%',
    borderRadius: '8px',
  },
  OurFounderWordsSection: {
    backgroundColor: '#eee',
    padding: '50px 0',
    display: 'flex',
    alignItems: 'center',
    flexDirection: 'column',
  },
  OurFounderWordsContent: {
    flex: '1',
    paddingRight: '50px',
    textAlign: 'center',
  },
  OurFounderWordsParagraph: {
    fontSize: '1rem',
    color: '#555',
  },
  OurVisionSection: {
    backgroundColor: '#eee',
    padding: '50px 0',
    display: 'flex',
    alignItems: 'center',
    flexDirection: 'column',
  },
  OurVisionContent: {
    flex: '1',
    paddingLeft: '50px',
    textAlign: 'center',
  },
  OurVisionParagraph: {
    fontSize: '1rem',
    color: '#555',
  },
  OurMissionSection: {
    backgroundColor: '#eee',
    padding: '50px 0',
    display: 'flex',
    alignItems: 'center',
    flexDirection: 'column',
  },
  OurMissionContent: {
    flex: '1',
    paddingRight: '50px',
    textAlign: 'center',
  },
  OurMissionParagraph: {
    fontSize: '1rem',
    color: '#555',
  },
  footer: {
    backgroundColor: '#333',
    color: 'white',
    padding: '30px',
    bottom: 0,
    width: '100%',
  },
};

const NavBar = () => (
  <nav style={{ ...styles.nav, marginTop: '0' }}> {/* Added marginTop: '0' */}
    <div style={styles.logo}>Logo</div>
    <ul style={styles.navUl}>
      <li style={styles.navLi}>Home</li>
      <li style={styles.navLi}>Our Missions</li>
      <li style={styles.navLi}>About Us</li>
      <li style={styles.navLi}>Clubs</li>
      <li style={styles.navLi}>Contact Us</li>
    </ul>
    <div style={styles.loginButton}>Login</div>
  </nav>
);

const AboutSection = () => (
  <div style={styles.aboutSection}>
    <div>
      <h1 style={styles.introductionHeading}>Introduction</h1>
      <p style={styles.introductionContent}>Andhra University is not just one of the oldest educational institutions in the country, but is also the first to be conceived as a residential and teaching-cum-affiliating University, mainly devoted to post-graduate teaching and research.

The people of the State have an emotional attachment to the institution, since it came into being after a prolonged and collective struggle of the Telugu elite for a University in the educationally backward northern Circars and Ceded districts of the erstwhile Madras Presidency.

Andhra University was constituted in the year 1926 by the Madras Act of 1926. The 97-year-old institution is fortunate to have Sir C.R. Reddy as its founder Vice-Chancellor, as the steps taken by this visionary proved to be fruitful in the long run.</p>
    </div>
  </div>
